var GithubFeed={init:function(e){this.count=e.count||0;this.order=e.order||"desc";this.url="https://api.github.com/users/"+e.username+"/repos?per_page="+this.count+"&sort=created&direction="+this.order;this.container=e.container;this.onComplete=e.onComplete||function(){};this.fetch()},xmlHttp:function(){return new XMLHttpRequest},objJSON:function(e,t){var n=this;var r=n.getCache();if(r!==null){t(JSON.parse(r));return}var i=n.xmlHttp();e.url=e.url||location.href;i.open("GET",e.url,true);i.send(null);i.onreadystatechange=function(){if(i.status===200&&i.readyState===4){n.setCache(i.responseText);t(i.responseText)}}},setCache:function(e){if(sessionStorage){sessionStorage.setItem("repos:",JSON.stringify(e))}},getCache:function(){if(sessionStorage){return sessionStorage.getItem("repos:")}else{return false}},bindTemplate:function(e,t,n,r){var i="";i+='<div class="repo-container">';i+='<h3 class="repo-name"><a href="'+n+'">'+e+"</a></h3>";i+='<div class="repo-description">'+t+"</div>";i+="</div>";return i},fetch:function(){var e=this;e.objJSON({url:e.url},function(t){var n=JSON.parse(t),r=document.querySelector(e.container),i="",s;for(s=0;s<n.length;s++){i+=e.bindTemplate(n[s].name,n[s].description,n[s].svn_url,n[s].stargazers_count)}r.innerHTML=i;e.onComplete()})}}
